            <script>
                function calculateCenter(path) {
                    var bbox = path.getBBox();
                    return {
                        x: bbox.x + bbox.width / 2,
                        y: bbox.y + bbox.height / 2
                    };
                }

                function addLabels() {
                    var svg = document.getElementById('map');
                    var paths = svg.querySelectorAll('path');
                    paths.forEach(function(path) {
                        var id = path.getAttribute('id');
                        var name = path.getAttribute('name');
                        var center = calculateCenter(path);

                        // Create text element
                        var text = document.createElementNS('http://www.w3.org/2000/svg', 'text');
                        text.setAttribute('x', center.x);
                        text.setAttribute('y', center.y);
                        text.setAttribute('text-anchor', 'middle');
                        text.setAttribute('fill', 'white');
                        text.setAttribute('font-size', '20px');
                        text.textContent = name;

                        // Append text element to SVG
                        svg.appendChild(text);
                    });
                }
                addLabels();
            </script>

            <script>
                function sendMessage(cityName) {
                    
                    $.ajax({
                        url: "{{ route('project.projectmap') }}",
                        method: "GET",
                        contentType: "application/json",
                        data: {
                            city: cityName
                        },
                        
                        success: function(response) {
                            if (!response || !response.projects_with_images || response.projects_with_images.length === 0) {
                                $("#barisal").empty().append('<h3 class="text-center align-items-center mt-5 mx-5">No data found</h3>');
                                $("#hover_sub").empty();
                                return;
                            }
                            else{
                            $("#barisal").empty();
                            $("#hover_sub").empty();
                            var newTitle = $('<h2>').addClass('hover-menu-title').text(response.projects_with_images[0]
                                .project.dist);
                            $("#barisal").append(newTitle);

                            var projectLinks = "";
                            response.projects_with_images.forEach(function(project, index) {
                                var className = (index === 0) ? 'hover-menu-listing-element bg-success mb-1' :
                                    'hover-menu-listing-element mb-1';
                                projectLinks += '<a href="#" class="' + className + '" onclick="getId(event, ' +
                                    project.project.project_id + ', this)">' +
                                    project.project.project_name +
                                    '</a>';
                            });
                            $("#barisal").append(projectLinks);

                            var titleElement = $('<h3>').addClass('hover-sub-menu-title').text(response.projects_with_images[0]
                                .project.description);
                            var lineElement = $('<div>').addClass('line-fox');
                            var imageNames = response.projects_with_images[0].images[0].image_name;
                            var firstImageName = imageNames.split('|')[0];
                            var imagePath = "./images/uploads/" + firstImageName;
                            $("#project_image").attr("src", imagePath);

                            var imageElement = $('<img>').attr({
                                'id': 'project_image',
                                'src': imagePath,
                                'alt': ''
                            });
                            var imageContainer = $('<div>').addClass('image').append(imageElement);

                            var descriptionParagraph = $('<p>').addClass('px-4 description_under_image').text(response.projects_with_images[0]
                                .project.description);   
                            var contentContainer = $('<div>').addClass('content');

                            let new_date = (response.projects_with_images[0]
                                .project.created_at)
                            var formattedDate = moment(new_date).format('DD MMM YYYY');

                            var locationItem = $('<p>').addClass('content-item new_location').html('<i class="fa fa-map-marker mr-3"></i>' + response.projects_with_images[0]
                            .project.location + ', ' + response.projects_with_images[0]
                            .project.dist);

                            var dateItem = $('<p>').addClass('content-item new_date').html('<i class="fa-solid fa-clock mr-3" aria-hidden="true"></i>' +formattedDate);
                            
                            contentContainer.append(locationItem, dateItem);

                            var projectId =response.projects_with_images[0].project.project_id;

                            var detailsLink = $('<a>').attr({
                                'id': 'view_details',
                                'href': '/details-view/' + projectId,
                                'class': 'button border text-center mt-3 mx-4'
                            }).text('Details view');

                            var containerDiv = $('<div>').append(titleElement, lineElement, imageContainer, descriptionParagraph, contentContainer, detailsLink);

                            $("#hover_sub").html(containerDiv);
                            }
                        },
                        error: function(xhr, status, error) {
                            console.error("AJAX request failed:", error);
                        }
                    });
                }
                $(".hox").click(function() {
                    var cityName = $(this).attr("class").split(" ")[
                        1];
                    sendMessage(cityName);
                });

                function getId(event, id, element) {
                    event.preventDefault();
                    var links = document.querySelectorAll('.hover-menu-listing-element'); // Get all links
                    for (var i = 0; i < links.length; i++) {
                        links[i].classList.remove('bg-success'); // Remove bg-success class from all links
                    }
                    element.classList.add('bg-success');
